const {
  JWKS: { KeyStore },
} = require('jose');

const keystore = new KeyStore();

function generateJWKS() {
  keystore.generateSync('RSA', 2048, { use: 'sig' });
  keystore.generateSync('RSA', 2048, { use: 'enc' });
  keystore.generateSync('EC', 'P-256', { use: 'sig' });
  keystore.generateSync('EC', 'P-256', { use: 'enc' });
  keystore.generateSync('OKP', 'Ed25519', { use: 'sig' });

  const { keys } = keystore.toJWKS(true);
  return keys;
}
